import React, { useState, useEffect, useContext } from 'react';
import './HistoryPage.css';
import HistoryItem from './HistoryItem';
import { useNavigate } from 'react-router-dom';
import { AuthContext } from './AuthContext';
import API_BASE_URL from './Config';

const HistoryPage = () => {
  const [historyItems, setHistoryItems] = useState([]);
  const [page, setPage] = useState(0);
  const [totalPages, setTotalPages] = useState(0);
  const [editItem, setEditItem] = useState(null);
  const navigate = useNavigate();
  const { authFetch } = useContext(AuthContext);

  useEffect(() => {
    const fetchHistoryItems = async () => {
      try {
        const response = await authFetch(`${API_BASE_URL}/history?page=${page}&size=10`);
        const data = await response.json();
        setHistoryItems(data.content);
        setTotalPages(data.totalPages);
      } catch (error) {
        console.error('Error fetching history items:', error);
      }
    };

    fetchHistoryItems();
  }, [authFetch, page]);

  const handleEdit = (item) => {
    setEditItem(item);
    navigate(`/history/${item.id}`, { state: { item, isEditing: true } });
  };

  const handleDelete = async (id) => {
    try {
      await authFetch(`${API_BASE_URL}/history/${id}`, {
        method: 'DELETE'
      });
      setHistoryItems(historyItems.filter(item => item.id !== id));
    } catch (error) {
      console.error('Error deleting history item:', error);
    }
  };

  const handleSave = async (editedItem) => {
    try {
      const response = await authFetch(`${API_BASE_URL}/history`, {
        method: editedItem.id ? 'PUT' : 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(editedItem)
      });
      const data = await response.json();

      if (editedItem.id) {
        setHistoryItems(historyItems.map(item => (item.id === editedItem.id ? data : item)));
      } else {
        setHistoryItems([...historyItems, data]);
      }

      setEditItem(null);
    } catch (error) {
      console.error('Error saving history item:', error);
    }
  };

  const handleAdd = () => {
    const newItem = {
      id: null,
      title: '',
      doctorId: '',
      description: '',
      prescription: '',
      diagnosis: '',
      appointmentAt: new Date().toISOString().split('T')[0],
      createdAt: new Date().toISOString(),
      modifiedAt: new Date().toISOString()
    };
    setEditItem(newItem);
    navigate(`/history/new`, { state: { item: newItem, isEditing: true } });
  };

  const handleItemClick = (item) => {
    navigate(`/history/${item.id}`, { state: { item } });
  };

  const handlePageChange = (newPage) => {
    if (newPage >= 0 && newPage < totalPages) {
      setPage(newPage);
    }
  };

  return (
    <div className="history-page">
      <header className="history-header">
        <h1>진료 이력 확인</h1>
        <div className="header-controls">
          <input type="text" placeholder="검색하기..." />
          <button className="add-button" onClick={handleAdd}>
            <i className="fas fa-plus"></i> 새 진료 추가하기
          </button>
        </div>
      </header>
      <div className="history-list">
        {historyItems.map((item, index) => (
          <HistoryItem
            key={index}
            item={item}
            onClick={() => handleItemClick(item)}
            onEdit={() => handleEdit(item)}
            onDelete={() => handleDelete(item.id)}
          />
        ))}
      </div>
      <div className="pagination-controls">
        <button onClick={() => handlePageChange(page - 1)} disabled={page === 0}>이전</button>
        <span>{page + 1} / {totalPages}</span>
        <button onClick={() => handlePageChange(page + 1)} disabled={page === totalPages - 1}>다음</button>
      </div>
    </div>
  );
};

export default HistoryPage;
